                    console.log(pastTrendingData)
                },
                (error) => {
                    setIsLoaded(true);
                    setError(error);
                }
            )
        fetch("/topTenTrendingMoviesNow")
            .then(res => res.json())
            .then(
                (trendingData) => {
                    setIsLoaded(true);
                    setCurrentTrendingTen(trendingData);
                    console.log(trendingData)
                },
                (error) => {
                    setIsLoaded(true);
                    setError(error);
                }
            )
        fetch("/topTenMoviesNow")
            .then(res => res.json())
            .then(
                (movieData) => {
                    setIsLoaded(true);
                    setCurrentTopTen(movieData);
                    console.log(movieData)
                },
                (error) => {
                    setIsLoaded(true);
                    setError(error);
                }
            )
      }, []
